def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = True  # Reset wait_for_nl to True at the beginning
    for char in prefix:
        if wait_for_nl:
            if char == ' ':
                current_column += 1
            elif char == '\t':
                current_column += 4
            elif char == '\n':
                current_column = 0  # Reset current_column to 0 when a newline is encountered
                wait_for_nl = True  # Set wait_for_nl to True after encountering a newline
                lines.append(current_line)
                current_line = ""
            else:
                wait_for_nl = False  # Set wait_for_nl to False after finishing the indentation
                current_line += char
        else:
            current_line += char
    res = ''.join(lines)
    return res, prefix[len(res):]
